import React, { Component } from 'react';
import { Button } from 'antd';
import TopNavBar from "./components/TopNavBar"
import ProjectSummary from "./components/ProjectSummary"
import ArticleSummary from "./components/ArticleSummary"
import ContactMe from "./components/ContactMe"
import BlogMain from "./components/BlogMain"
import EntryMain from "./components/EntryMain"
import './App.css';

import { EntryTrunc } from './data/Entry'

import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import TerminalDisplay from './components/Terminal';

const articleEntries = [
  //{EntryTrunc(title="hello", published="1/1/1", summary="this is my summary", resource="www.")}
  {title:"hello1", published:"True", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.", slug:"slug1"} as EntryTrunc,
  {title:"hello2", published:"True", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.", slug:"slug2"} as EntryTrunc,
  {title:"hello3", published:"True", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.", slug:"slug3"} as EntryTrunc,
  {title:"hello4", published:"True", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.", slug:"slug4"} as EntryTrunc,
]

const projectEntries = [
  {title:"hello1", published:"True", code:"pythonxy", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.test", slug:"slug1"} as EntryTrunc,
  {title:"hello2", published:"True", code:"pythonxy", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.test", slug:"slug1"} as EntryTrunc,
  //{title:"hello2", published:"True", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.test", slug:"slug2"} as EntryTrunc,
  //{title:"hello3", published:"True", summary:"this is my summary", timestamp:"2020-05-06", resource:"www.test", slug:"slug3"} as EntryTrunc,
]

class App extends Component {
  render() {
    return (
      <div className="App">
        <Router>
          <TopNavBar />
          <div className="main">
            <Switch>
                <Route path="/home">
                  <div className="parallax">
                    <div className="fade-in-title">hello</div>
                  </div>
                  <h1 style={{marginTop:"20px"}}>--- Blah Blah Blah Recent projects ---</h1>
                  <TerminalDisplay entries={projectEntries}/>
                  <ArticleSummary entries={articleEntries} />
                  <ContactMe/>
                  {/*<div className="filler"></div>*/}
                </Route>
                <Route exact path="/blog" component={BlogMain}/>
                <Route path="/:slug" component={EntryMain}/>
            </Switch>
          </div>
        </Router>
      </div>
    );
  }
}
                  //<ProjectSummary entries={projectEntries}/>

        {/*<Button type="primary">Button</Button>*/}
export default App;
